import React from 'react'; 
import Tilt from 'react-tilt';
import './Logo.css';
import ai from './AI.png';

class Logo extends React.Component {
	constructor(){
		super();
		this.wrapper = React.createRef();
	}

	render(){
		return (
			<div ref={this.wrapper} className='ma4 mt0' style={{height: 100, width: 100 }}>
				<Tilt className="Tilt br2 shadow-2" options={{ max : 50 }} > 
					<img className="Tilt-inner pa3" style={{paddindTop: '5px'}} alt='' src={ai} />  
				</Tilt>
			</div>
		);
	}
}

export default Logo;
